CREATE DEFINER=`root`@`localhost` PROCEDURE `log`(
in ficha varchar(10),
in id varchar(20)
)
BEGIN

declare login boolean;

set login=(select idEstudiante, concat(Nombres,' ',Apellidos) as student, Estado 
from student 
where idEstudiante = id and Ficha= ficha);

set @state=(select Estado from student where idEstudiante=id and Ficha= ficha);
set @user=(select concat(Nombres,' ',Apellidos) as student from student 
where idEstudiante = id and Ficha= ficha);

set @wrong=('El Usuario No se encuentra');
set @valid=('El Usuario ',idEstudiante,' Ya a Culminado la prueba');
set @agree=('Bienvenido +');

if (@login)=false then
select @wrong;
end if;

if (@state)= 'Terminado' then
select @valid;
else
select @agree, @user;
end if;

END ;;
